import logo from './logo.svg';
import './App.css';
import Personal from "./personal";
import { useEffect } from "react";

function App() {
	useEffect(() => {
		document.title = "Ezra Personal Site";
	});
  return (
	  <>
	  <title>Ezra's Personal Site</title>
	  <body>
	  	<Personal />
	  </body>
	  </>
  );
}

export default App;
